    function isReviewerScoreTooHigh(
        int reviewerScoreOnThisClient,
        int[] memory quarters,
        int interQtr
    ) public pure returns (bool) {
        if (reviewerScoreOnThisClient > (quarters[2] + interQtr)) {
            return true;
        }
        return false;
    }

    function isReviewerScoreTooLow(
        int reviewerScoreOnThisClient,
        int[] memory quarters,
        int interQtr
    ) public pure returns (bool) {
        if (reviewerScoreOnThisClient < (quarters[0] - interQtr)) {
            return true;
        }
        return false;
    }

    function getCreditEvent(
        address wallet,
        uint index
    ) public view returns (int, uint) {
        if (index < clients[wallet].scores.length)
            return (
                clients[wallet].scores[index].score,
                clients[wallet].scores[index].time
            );
        return (0, 0);
    }

    function getPunishedList() public view returns (address[] memory) {
        return punishList;
    }

    function getAddresses() public view returns (address[] memory) {
        return addresses;
    }

    function getClientCount() public view returns (uint) {
        return addresses.length;
    }

    function getClient(
        address wallet
    )
        public
        view
        returns (uint256, uint256, uint256, uint[] memory, string memory)
    {
        return (
            clients[wallet].level,
            clients[wallet].experience,
            clients[wallet].experienceNext,
            clients[wallet].events,
            clients[wallet].publicKey
        );
    }

    function getMedian(int[] memory arr) public pure returns (int) {
        // arr is already sorted
        int median;
        uint mid = arr.length / 2 - 1;

        if (arr.length % 2 == 0) {
            median = (arr[mid - 1] + arr[mid + 1]) / 2;
        } else {
            median = arr[mid];
        }

        return median;
    }

