    function min(int[] memory arr) public pure returns (int) {
        int val = arr[0];
        for (uint256 index = 0; index < arr.length; index++) {
            if (val > arr[index]) {
                val = arr[index];
            }
        }
        return val;
    }

    function max(int[] memory arr) public pure returns (int) {
        int val = arr[0];
        for (uint256 index = 0; index < arr.length; index++) {
            if (val < arr[index]) {
                val = arr[index];
            }
        }
        return val;
    }
